  Texas COVID-19 Vaccine Tracker





  The reach of COVID-19 on Texas and the world has been devastating. As our state joins a global effort to put coronavirus into our past, we are tracking the Texas vaccine roll-out as it unfolds in real-time.
  Texas has 24,068,624 people aged 12 and older who are currently eligible for the vaccine. As of Oct 07, 2021, the state has:


   | Fully Vaccinated: 15,042,917 people or 62% of the population 12+  | Vaccinated w/ At Least One Dose: 17,417,909 people or 72% of the population 12+  | Administered: 20,469 doses in one day on Oct 07, 2021 or 0.09% of the population 12+  | A 7-Day Average of 53,240 administered per day or 0.22% of the population 12+



